import React from "react";
import PropTypes from "prop-types";

function List({ headers, data, uniqueKey, renderCell }) {
  return (
    <div className="table-container">
      {data && data.length > 0 ? (
        <table className="dynamic-table">
          <thead>
            <tr>
              {headers.map((header, index) => (
                <th key={index}>{header.label}</th>
              ))}
            </tr>
          </thead>
          <tbody>
            {data.map((item) => (
              <tr key={item[uniqueKey]}>
                {headers.map((header, index) => (
                  <td key={index}>
                    {renderCell && renderCell[header.key]
                      ? renderCell[header.key](item[header.key], item)
                      : item[header.key]}
                  </td>
                ))}
              </tr>
            ))}
          </tbody>
        </table>
      ) : (
        <p>No data available.</p>
      )}
    </div>
  );
}

List.propTypes = {
  headers: PropTypes.arrayOf(
    PropTypes.shape({
      label: PropTypes.string.isRequired, // Header name
      key: PropTypes.string.isRequired, // Corresponding key in data
    })
  ).isRequired,
  data: PropTypes.array.isRequired,
  uniqueKey: PropTypes.string.isRequired,
  renderCell: PropTypes.objectOf(PropTypes.func), // Optional: Custom cell renderers
};

export default List;
